import React from 'react'
import Carousel from 'better-react-carousel'
import pic from "../public/im"

const Gallery = () => {
  return (
    <Carousel cols={3} rows={1} gap={10} loop>
      <Carousel.Item>
        <img width="25%" src="./public/images/omelette.jpeg" alt="Omelette pic" />
      </Carousel.Item>
      <Carousel.Item>
        <img width="25%" src="https://picsum.photos/800/600?random=2" />
      </Carousel.Item>
      <Carousel.Item>
        <img width="25%" src="https://picsum.photos/800/600?random=3" />
      </Carousel.Item>
      <Carousel.Item>
        {/* anything you want to show in the grid */}
      </Carousel.Item>
      {/* ... */}
    </Carousel>
  )
}

export default Gallery;
